crearGrafico(
  "exponencialAInvertir",
  function () {
    exponencialAInvertir.setCoordSystem(-4, 4, -4, 4);
    exponencialAInvertir.registerObjectUpdateListener("a", "cambiaBaseExp");
    exponencialAInvertir.evalCommand("g(x)=x");
    exponencialAInvertir.setColor("g", 150, 150, 150);
    exponencialAInvertir.setLineStyle("g", 2);
  },
  undefined,
  undefined,
  undefined,
  ""
);

crearGrafico(
  "inversaDeExponencial",
  function () {
    inversaDeExponencial.setCoordSystem(-4, 4, -4, 4);
    inversaDeExponencial.registerObjectUpdateListener("a", "cambiaBaseLog");
    inversaDeExponencial.evalCommand("g(x)=x");
    inversaDeExponencial.setColor("g", 150, 150, 150);
    inversaDeExponencial.setLineStyle("g", 2);
  },
  undefined,
  undefined,
  undefined,
  ""
);
function cambiaBaseExp() {
  const a = exponencialAInvertir.getValue("a");
  inversaDeExponencial.unregisterObjectUpdateListener("a");
  inversaDeExponencial.setValue("a", a);
  inversaDeExponencial.registerObjectUpdateListener("a", "cambiaBaseLog");
}
function cambiaBaseLog() {
  const a = inversaDeExponencial.getValue("a");

  exponencialAInvertir.unregisterObjectUpdateListener("a");
  exponencialAInvertir.setValue("a", a);
  exponencialAInvertir.registerObjectUpdateListener("a", "cambiaBaseExp");
}

function invertirGrafico(grafico) {
  const g = document.getElementById(grafico);
  g.classList.toggle("graficoInvertido");
}
